window.bookSummaryJSON = "<p><b>One of my mates is dead.</b></p> <p><b>The rest of them have been taken hostage.</b></p> <p><b>And me? I’m just a crazy demon-goddess on a warpath.</b></p> <p>Zeus has gone too far this time. There are some things I can forgive, but this isn’t one of them.</p> <p>My only option is to recruit an army of monsters to destroy the god who’s supposed to rule over us all.</p> <p>In order to do that, I have to make two trips.</p> <p>First, I must visit the monster council—who all hate vampires—and beg for their help in the battle to come.</p> <p>Second, I’ll need to travel to hell to free the Fomorians, an enslaved species of monsters who have been locked away for thousands of years by my biological father.</p> <p>I’ll save my mates, kill a god, and reclaim the crown that was always supposed to be mine.</p> <p>What could possibly go wrong?</p> <p>Zeus, I’m coming for you.</p> <p>And by the time I’m done castrating your micropenis, you’ll understand why this particular monster craves blood.<br> <br> <b><i>Blood </i></b><b>is the fifth and final book of the Prodigium Academy series. This book contains strong language, sexual situations, violence, and a bunch of sexy, monstrous boyfriends the FMC doesn’t have to choose between. This series does contain MM, MFM, and MMF elements.</b></p>"; 
